import './App.css';
import Homepage from './pages/homepage/Homepage';
import { Switch, Route } from 'react-router-dom';

function App() {

  const HatsPage = () => (
    <div>
      <h1>HATS PAGE </h1>
    </div>
  );

  return (

    <Switch>
      <Route exact path='/' component={HomePage} />
      <Route path='/hats' component={HatsPage} />
    </Switch>


  );
}

export default App;
